import React from "react";
import ListOfSongs from "../Common/ListOfSongs";

const SongsList = () => {
  return (
    <div>
      {ListOfSongs.map((item) => (
        <div>
          <div>
            <h1>{item.Name}</h1>
          </div>
          <div style={{ marginLeft: "500px", marginTop: "-90px" }}>
            <h1>{item.Duration}</h1>
          </div>
        </div>
      ))}
    </div>
  );
};
export default SongsList;
